import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { AuthService } from '../../../../services/auth.service';

@Component({
  selector: 'app-mfa',
  template: `
    <div class="auth-container">
      <div class="auth-card">
        <div class="auth-header">
          <h1>üîê Verification</h1>
          <p class="subtitle">We've sent a verification code to your KU email</p>
        </div>

        <form [formGroup]="mfaForm" (ngSubmit)="onSubmit()" class="auth-form">
          <div class="form-group">
            <label for="code">Verification Code</label>
            <input 
              type="text" 
              id="code"
              formControlName="code"
              placeholder="Enter 6-digit code"
              maxlength="6"
              [class.error]="mfaForm.get('code')?.invalid && mfaForm.get('code')?.touched"
            >
            <div class="error-message" *ngIf="mfaForm.get('code')?.invalid && mfaForm.get('code')?.touched">
              Verification code is required
            </div>
          </div>

          <button 
            type="submit" 
            class="btn btn-primary full-width"
            [disabled]="mfaForm.invalid || isLoading"
          >
            <span *ngIf="!isLoading">Verify</span>
            <span *ngIf="isLoading">Verifying...</span>
          </button>
        </form>

        <div class="auth-footer">
          <p>Didn't receive the code? <a (click)="resendCode()" class="resend-link">Resend</a></p>
        </div>

        <div class="error-alert" *ngIf="errorMessage">
          {{ errorMessage }}
        </div>

        <div class="success-alert" *ngIf="successMessage">
          {{ successMessage }}
        </div>
      </div>
    </div>
  `,
  styles: [`
    .resend-link {
      color: #667eea;
      text-decoration: none;
      font-weight: 500;
      cursor: pointer;
    }

    .resend-link:hover {
      text-decoration: underline;
    }

    .success-alert {
      background: #d4edda;
      color: #155724;
      padding: 1rem;
      border-radius: 8px;
      margin-top: 1rem;
      border: 1px solid #c3e6cb;
    }
  `]
})
export class MfaComponent {
  mfaForm: FormGroup;
  isLoading = false;
  errorMessage = '';
  successMessage = '';
  email = '';

  constructor(
    private fb: FormBuilder,
    private authService: AuthService,
    private router: Router
  ) {
    this.mfaForm = this.fb.group({
      code: ['', [Validators.required, Validators.minLength(6), Validators.maxLength(6)]]
    });

    // Get email from state or localStorage
    this.email = localStorage.getItem('pending_email') || '';
    if (!this.email) {
      this.router.navigate(['/login']);
    }
  }

  onSubmit() {
    if (this.mfaForm.valid) {
      this.isLoading = true;
      this.errorMessage = '';

      this.authService.verifyMFACode(this.email, this.mfaForm.value.code).subscribe({
        next: (response: any) => {
          this.isLoading = false;
          localStorage.removeItem('pending_email');
          this.router.navigate(['/matches']);
        },
        error: (error: any) => {
          this.isLoading = false;
          this.errorMessage = error.error?.message || 'Invalid verification code. Please try again.';
        }
      });
    }
  }

  resendCode() {
    this.authService.sendMFACode(this.email).subscribe({
      next: () => {
        this.successMessage = 'Verification code sent! Check your email.';
        setTimeout(() => this.successMessage = '', 3000);
      },
      error: (error: any) => {
        this.errorMessage = 'Failed to resend code. Please try again.';
      }
    });
  }
}
